from typing import List, Dict
from selenium.webdriver import Chrome, ChromeOptions
from selenium.webdriver.common.by import By
from selenium.webdriver.support import expected_conditions as EC
from selenium.webdriver.support.wait import WebDriverWait


class AudioBooks:
    def __init__(self):
        options = ChromeOptions()

        options.add_argument("--start-maximized")
        options.add_experimental_option("excludeSwitches", ["enable-automation"])

        self.driver = Chrome(options=options)
        self.wait = WebDriverWait(self.driver, 10)
        self.base_url = "https://www.audible.com/search?pageSize=50"

    def page_parser(self) -> List[Dict]:
        """
        Extract data from the current page.

        This function parses the current webpage and extracts information about each product listed on the page.
        It returns a list of dictionaries, where each dictionary contains the title and product URL of a product.

        Returns:
        list: A list of dictionaries containing 'title' and 'product_url' keys for each product on the page.
        """
        page_data = []
        products = self.wait.until(EC.presence_of_all_elements_located((By.CSS_SELECTOR, 'li.bc-list-item.productListItem')))

        for product in products:
            title = product.find_element(By.CSS_SELECTOR, 'h3.bc-heading.bc-color-link').text
            product_url = product.find_element(By.CSS_SELECTOR, 'h3.bc-heading.bc-color-link>a').get_attribute('href')
            # Similarly, you can parse other details of a product

            page_data.append({"title": title, "product_url": product_url})

        return page_data

    def scrape_single_page(self, page_number: int) -> List[Dict]:
        """
        Scrape data from a single page.

        This function navigates to a specific page and extracts data from it using the page_parser function.
        It returns a list of dictionaries, where each dictionary contains the title and product URL of a product.

        Parameters:
        page_number (int): The page number to scrape.

        Returns:
        list: A list of dictionaries containing 'title' and 'product_url' keys for each product on the page.
        """
        print(f"scraping page {page_number}....")
        self.driver.get(f"{self.base_url}&page={page_number}")

        return self.page_parser()

    def scrape_multiple_page(self, pages: int) -> List[Dict]:
        """
        Scrape data from multiple pages.

        This function navigates to each page from 1 to 'pages' and extracts data using the page_parser function.
        It returns a list of dictionaries, where each dictionary contains the title and product URL of a product.

        Parameters:
        pages (int): The number of pages to scrape.

        Returns:
        list: A list of dictionaries containing 'title' and 'product_url' keys for each product on all pages.
        """
        final_data = []

        for page in range(1, pages+1):
            print(f"scraping page {page}....")
            self.driver.get(f"{self.base_url}&page={page}")

            final_data += self.page_parser()

        return final_data


if __name__ == "__main__":
    obj = AudioBooks()
    # print(obj.scrape_single_page(page_number=2))
    print(obj.scrape_multiple_page(pages=3))

